def get_response(url):
    response_buffer = BytesIO()

    curl = pycurl.Curl()
    curl.setopt(curl.URL, url)
    curl.setopt(curl.WRITEDATA, response_buffer)

    try:
        curl.perform()
    except pycurl.error as e:
        return f"Error: {e}"

    response = response_buffer.getvalue().decode('utf-8')
    curl.close()

    return response

